//Adopted from: https://github.com/ayushn21/Playfair-Cipher

package ie.gmit.sw.ai;

import java.io.File;
import java.io.FileReader;
import java.util.*;
import java.util.concurrent.ThreadLocalRandom;


public class Main {

    public static void main(String[] args) {
        char [] sample = new char[200];
        int charsRead = 0;
        char[] key = PlayfairBlock.getBlockLetters();
        File encryptFile = new File("resources/cyphertext-2018.txt");

        try {
            FileReader fr = new FileReader(encryptFile);
            charsRead = fr.read(sample);
        } catch (Exception e) {
            e.printStackTrace();
        }

        System.out.println("Sample: "+ String.valueOf(sample));
        System.out.println("Characters read: "+ String.valueOf(charsRead));
        System.out.printf("Key: %s%n", String.valueOf(key).replaceAll("[,\\s\\[\\]]", ""));
        shuffle(key);
        System.out.println("Random Key: " + String.valueOf(key));

        System.out.println("Decrypted text: " + decryptText("", "THEQUICKBROWNFXMPDVLAZYGS"));

    }

    private static String decryptText(String inputText, String key)
    {
        PlayfairBlock playfairBlock = new PlayfairBlock(key);
        char[][] digraphs = playfairBlock.prepareInputText(inputText);
        StringBuilder sb_decryptedTextBuilder = new StringBuilder();

        for(char[] each_digraph : digraphs)
        {
            sb_decryptedTextBuilder.append(playfairBlock.decryptDigraph(each_digraph));
        }
        return sb_decryptedTextBuilder.toString();
    }

    private static void shuffle(char[] key) {
        int index;
        Random random = ThreadLocalRandom.current();
        for (int i = key.length - 1; i > 0; i--) {
            index = random.nextInt(i + 1);
            if (index != i) {
                key[index] ^= key[i];
                key[i] ^= key[index];
                key[index] ^= key[i];
            }
        }
    }

}
